{'name': 'HungWei Chiu', 'bio': 'HungWei started his career at Open Networking Foundation in 2019 and has been involved in various SDN-related open-source projects for years. He is working on integrating SDN concepts with Cloud-Native approaches to building a Kubernetes-based system for the 5G environment.

HungWei is one of the co-founders of SDNDS-TW and CNTUG, both are local communities based in Taiwan. SDNDS-TW focuses on the SDN and networking topics and CNTUG focuses on the Cloud Native approaches, in addition, HungWei devoted himself to share the knowledge and experience by writing blog posts and delivering the speech in various confluence and meetup, including COSCUP 2018 x openSUSE. Asia GNOME.Asia, Open Source Networking Days Taiwan, and so on.

In addition to public blog resources, he also teaches the Kubernetes and Linux Network via the online course platform and hosts a Facebook page çŸ½è°·ç‰›çš„è€•ç”°ç­†è¨˜(Technologynoteniu) to share the experience and knowledge.'}

