{'name': 'Eriol Fox', 'bio': "Eriol has been working as a Designer for 10 years working in for-profits and then moving into NGO's and open source software organisations, working on complex problems like sustainable food systems, peacebuilding and crisis response technology. Eriol now contracts at various open source and tech projects including most recently the Open Food Network. They are also part of the core teams at Open Source Design (http://opensourcedesign.net/) and Human Rights Centred Design working group (https://hrcd.pubpub.org/) Mutual Aid World and Sustain UX & Design working group.
Eriol is a part-time funded PhD researcher at Newcastle University's Open Lab looking at how designers participate in humanitarian focussed open source software projects.

Eriol is a non-binary, queer person who uses they/them pronouns."}

