{'name': 'Wei-Chiu Chuang', 'bio': 'Wei-Chiu joined Cloudera in 2015 as a software engineer, where he leads the development of Clouderaâ€™s distributed storage system: the Hadoop Distributed File System (HDFS).

He is an active committer and Project Management Committee member in various Apache open source projects, including Apache Hadoop, HBase, Ozone and Submarine. He serves as the PMC Chair of the Apache Hadoop project as well as an Apache Software Foundation Member. He is also a founding member of Taiwan Data Engineering Association, a non-profit organization promoting better Data Engineering technologies and applications in Taiwan.

Wei-Chiu received his Ph.D. in Computer Science from Purdue University for his research in distributed systems and programming models.'}

